import React from "react";
import { Link } from "react-router-dom";

function NavBar({ user, setUser }) {
  function handleLogoutClick() {
    fetch("/logout", { method: "DELETE" }).then((r) => {
      if (r.ok) {
        setUser(null);
      }
    });
  }

  return (
    <header className="bg-amber-500 p-4 flex items-center justify-between">
      <div>
        <Link
          to="/"
          className="text-white text-xl font-semibold hover:text-amber-200"
        >
          Home
        </Link>
      </div>
      <div className="flex-1"></div>
      <div>
        {user ? (
          <button
            onClick={handleLogoutClick}
            className="bg-amber-600 text-white px-4 py-2 rounded hover:bg-amber-700"
          >
            Logout
          </button>
        ) : (
          <>
            <button className="bg-amber-600 text-white px-4 py-2 rounded hover:bg-amber-700 mr-2">
              <Link to="/signup">Signup</Link>
            </button>
            <button className="bg-amber-600 text-white px-4 py-2 rounded hover:bg-amber-700">
              <Link to="/login">Login</Link>
            </button>
          </>
        )}
      </div>
    </header>
  );
}

export default NavBar;
